import React from 'react';
import { Navbar, Nav, Form, FormControl, Button, DropdownButton, Dropdown, ButtonGroup} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function Navigation() {
return(
    
    <div className="Navigation">
        <Navbar bg="dark" variant="dark">
    <Navbar.Brand href="#home">ARCHIVE_SNS</Navbar.Brand>
    <Nav className="mr-auto">
        <Nav.Link href="#home">Home</Nav.Link>
        <Nav.Link href="#user_contorl">user_contorl</Nav.Link>

        <ButtonGroup vertical>

    <DropdownButton as={ButtonGroup} title="User_contorl" id="bg-vertical-dropdown-1">
        <Dropdown.Item eventKey="1">Dropdown link</Dropdown.Item>
        <Dropdown.Item eventKey="2">Dropdown link</Dropdown.Item>
    </DropdownButton>

</ButtonGroup>

        
    </Nav>
    <Form inline>
        <FormControl type="text" placeholder="Please enter your content" className="mr-sm-2" />
        <Button variant="outline-info">Search</Button>
        <Nav.Link href="#login">login</Nav.Link>
    </Form>
</Navbar>
			
    </div>
);
}
    export default Navigation;
